import React from 'react'
import Navbar from '../components/universal/Navbar';
import BattleInputs from '../components/battle/BattleInputs'
import FightButton from '../components/battle/FightButton'

import { useState, useEffect } from 'react';
import axios from 'axios';


export default function Battler() {
    console.log('in battle')
    const [cookies , setCookies] = useState(null)

    // getCookies()

    useEffect(() => {
        console.log("use effect!")
        getCookies()
    } ,[]);


    console.log(cookies)

    // get cookies info from database
    function getCookies() {
    axios({
        method: "GET",
        url:"cookies_db/",
        // '/api/cookies/?format=json'
        // 
        }).then((response)=>{ // success
            const data = response.data
            setCookies(data)
            console.log(response.data)
            console.log(cookies)

        }).catch((error) => { // failure
        if (error.response) {
            console.log(error.response);
            console.log(error.response.status);
            console.log(error.response.headers);
            }
        })}






    return (
        <>
        <div className="sm:mx-8 lg:mx-16 xl:mx-24 ht-screen bg-background">
            <Navbar />
            <BattleInputs cookies={cookies}/>
            <div className="flex justify-center">
                <FightButton/>
            </div>
        </div>
        </>

    );
}
